import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col, Image, Form, Button } from "react-bootstrap";

function App() {
  return (
    //Styles
    <>
    <style type="text/css">
        {`
        .btn-log {
          background-color: #8B0000;
  color: #FFFFFF;
        }
    `}
      </style>

    //React-boostrap
    <Container fluid>
      <Row>
        <Col>
          <Image
            src="https://images.pexels.com/photos/8448236/pexels-photo-8448236.jpeg"
            fluid
            rounded
          ></Image>
        </Col>
        <Col>
          <Image src="/images/1.png" fluid></Image>
          <Form>
            <Form.Group className="mb-3" controlId="formBasicEmail">
              <Form.Label>Usuario</Form.Label>
              <Form.Control type="email" placeholder="Ingresa tu usuario" />
            </Form.Group>

            <Form.Group className="mb-3" controlId="formBasicPassword">
              <Form.Label>Contraseña</Form.Label>
              <Form.Control type="password" placeholder="Ingresa tu contraseña" />
            </Form.Group>

            <Button className="button-tvp" variant="primary" type="submit">
              Ingresar
            </Button>
          </Form>
        </Col>
      </Row>
    </Container>
    </>
  );
}

export default App;
